import React from "react";
import { Redirect, Route } from "react-router-dom";

export default function PrivateRoute(props, {children, ...rest }) {
  // const {user} = props
  console.log(props);

  return (


    <Route
      {...rest}
      render={({ location }) =>
        true ? (
          children
        ) : (
          <Redirect
            to={{
              pathname: "/signin",
              state: { from: location }
            }}
          />
        )
      }
    />
  );
}
